import React from "react";
import { useResumeDataContext } from "../Providers/ResumeDataProvider";
import "../styles/wave.css"
import Typed from 'react-typed';

const navigation = [
    { name: 'Product', href: '#' },
    { name: 'Features', href: '#' },
    { name: 'Marketplace', href: '#' },
    { name: 'Company', href: '#' },
]
const TypingText = ({ text }) => (
    <Typed
        strings={[text]}
        typeSpeed={40}
        backSpeed={40}
        loop={true}
    />
);

const Home = () => {
    const { resumeData } = useResumeDataContext();
    return (
        <div id="home" class="h-screen flex justify-center items-center bg-gradient-to-tr from-[#b8b8b8] to-[#4b3eff]">
            {/* <div class ="wave overflow-y-hidden"></div> */}
            <h1 className="text-4xl font-mono">
                {"<h1> Hi I'm <span> "}
                <span className="text-red-800">
                    <TypingText text={()=>{<h1 class="text-base sm:text-lg md:text-xl lg:text-2xl xl:text-3xl 2xl:text-4xl font-mono">
  {"<h1> Hi I'm <span> "}
  <span class="text-red-800">{resumeData[0].name}!</span>
  {"</span> </h1>"}
</h1>}} />
                </span>
                {"</span> </h1>"}
            </h1>

        </div>
    )
}

export default Home;
